let GM='GM';
let GA='GA';
let GN='GN';

let gmAction=()=>{
    return{type:"GM"}
     
} 
let gaAction=()=>{
    return{type:GA}
}
let gnAction=()=>{
    return{type:GN}
}
export {gmAction,gaAction,gnAction,GM,GA,GN}
